import React from "react";
import "../style/login.css";
import { useState } from "react";

const Login = () => {
  const slidePage = document.querySelector(".slide-page");
  const progressText = document.querySelectorAll(".step p");
  const progressCheck = document.querySelectorAll(".step .check");
  const bullet = document.querySelectorAll(".step .bullet");
  let [current ,setCurrent] = useState(1);

  const handleNextFirst = (e) => {
    slidePage.style.marginLeft = "-25%";
    bullet[current - 1].className.add("active");
    progressCheck[current - 1].className.add("active");
    progressText[current - 1].className.add("active");
    setCurrent(current += 1);
  }
  const handleNextSecond = (e) => {
    slidePage.style.marginLeft = "-50%";
    bullet[current - 1].className.add("active");
    progressCheck[current - 1].className.add("active");
    progressText[current - 1].className.add("active");
   setCurrent( current += 1);
  }

  const handleNextThird = (e) => {
    slidePage.style.marginLeft = "-75%";
    bullet[current - 1].className.add("active");
    progressCheck[current - 1].className.add("active");
    progressText[current - 1].className.add("active");
    setCurrent(current += 1);
  }

  const handleSubmit = () => {
    bullet[current - 1].className.add("active");
    progressCheck[current - 1].className.add("active");
    progressText[current - 1].className.add("active");
    setCurrent(current += 1);
    setTimeout(function () {
      alert("Your Form Successfully Signed up");
    }, 800);
  }

  const handlePrev = (margin) => {
    slidePage.style.marginLeft = margin;
    bullet[current - 2].className.remove("active");
    progressCheck[current - 2].className.remove("active");
    progressText[current - 2].className.remove("active");
    setCurrent(current -= 1);
  }
  return (
    <div class="container">
      <header>Signup Form</header>
      <div class="progress-bar">
        <div class="step">
          <p>Name</p>
          <div class="bullet">
            <span>1</span>
          </div>
          <div class="check fas fa-check"></div>
        </div>
        <div class="step">
          <p>Contact</p>
          <div class="bullet">
            <span>2</span>
          </div>
          <div class="check fas fa-check"></div>
        </div>
        <div class="step">
          <p>Birth</p>
          <div class="bullet">
            <span>3</span>
          </div>
          <div class="check fas fa-check"></div>
        </div>
        <div class="step">
          <p>Submit</p>
          <div class="bullet">
            <span>4</span>
          </div>
          <div class="check fas fa-check"></div>
        </div>
      </div>
      <div class="form-outer">
        <form action="#">
          <div class="page slide-page">
            <div class="title">Basic Info:</div>
            <div class="field">
              <div class="label">First Name</div>
              <input type="text" />
            </div>
            <div class="field">
              <div class="label">Last Name</div>
              <input type="text" />
            </div>
            <div class="field">
              <button onClick={() => handleNextFirst("-25%")} class="firstNext next">Next</button>
            </div>
          </div>
          <div class="page">
            <div class="title">Contact Info:</div>
            <div class="field">
              <div class="label">Email Address</div>
              <input type="text" />
            </div>
            <div class="field">
              <div class="label">Phone Number</div>
              <input type="Number" />
            </div>
            <div class="field btns">
              <button onClick={() => handlePrevSecond("0%")} class="prev-1 prev">Previous</button>
              <button onClick={() => handleNextSecond("-50%")} class="next-1 next">Next</button>
            </div>
          </div>
          <div class="page">
            <div class="title">Date of Birth:</div>
            <div class="field">
              <div class="label">Date</div>
              <input type="text" />
            </div>
            <div class="field">
              <div class="label">Gender</div>
              <select>
                <option>Male</option>
                <option>Female</option>
                <option>Other</option>
              </select>
            </div>
            <div class="field btns">
              <button onClick={() => handlePrevThird("-25%")} class="prev-2 prev">Previous</button>
              <button onClick={() => handleNextThird("-75%")} class="next-2 next">Next</button>
            </div>
          </div>
          <div class="page">
            <div class="title">Login Details:</div>
            <div class="field">
              <div class="label">Username</div>
              <input type="text" />
            </div>
            <div class="field">
              <div class="label">Password</div>
              <input type="password" />
            </div>
            <div class="field btns">
              <button onClick={() => handlePrevFourth("-50%")} class="prev-3 prev">Previous</button>
              <button onClick={() => handleSubmit} class="submit">Submit</button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
};
export default Login;
